import './App.css'

const CardRow = (props) => {
    return (
        props.cards.map(card => {
            return <div key={card.id} className='card'>
                <div>
                    
                </div>
                <img src={'https://rsttur.ru' + card.image.lg} alt={""} className='image'/>
                <div style={{padding: "10px 20px 20px 20px"}}>
                    <div className='title'>{card.title}</div>
                    <div className='text'>{card.location}</div>
                    <div className='text'>{card.date.date}</div>
                    <div className='text'>{card.duration.day} дней {card.duration.night} ночей</div>
                    <h3 className='price'>{card.price.price} {card.price.currency}</h3>
                </div>
            </div>
        })
    )
}

export default CardRow;
